import React from 'react';
import axios from 'axios';

function App() {


  function submitClick() {
    alert('The link was clicked.');
    axios.get("http://localhost:5000/stock/value?function=CURRENCY_EXCHANGE_RATE&from_currency=BTC&to_currency=INR").then(res => {
      alert("values : " + { ...res.data });
    })
  }

  return (
    <div className="App">
      <h1>Crypto Values</h1>
      <table>
        <tr><th align="right">Crypto Code</th>
          <input name="crypto_name"></input><br />
        </tr>
        <tr>
          <th align="right">Currency</th> <input name="currency"></input><br />
        </tr>
        <tr>
          <button onClick={submitClick}>Submit</button>
          <input type="button" value="Cancel" name="Cancel"></input>
        </tr>
      </table>
    </div>
  );
}

export default App;
